const plateDetails = ({plate}) => {
    return (
        <div className="plate-details">
            <h4>{plate.title}</h4>
            <p><strong>Genre: </strong>plate.genre</p>
            <p><strong>Description: </strong>plate.description</p>
            <p><strong>Privacy: </strong>plate.privacy</p>
        </div>
    )
}

export default plateDetails
